SELECT MAX("lineorder"."lo_supplycost" + "dim_date"."d_daynuminweek") as agg_0, MIN("lineorder"."lo_commitdate" + "dim_date"."d_daynuminyear") as agg_1, MAX("lineorder"."lo_orderdate") as agg_2 FROM "dim_date" LEFT OUTER JOIN "lineorder" ON "dim_date"."d_datekey" = "lineorder"."lo_orderdate" LEFT OUTER JOIN "part" ON "lineorder"."lo_partkey" = "part"."p_partkey" LEFT OUTER JOIN "supplier" ON "lineorder"."lo_suppkey" = "supplier"."s_suppkey"  WHERE "supplier"."s_nation" NOT LIKE '%EG%YPT%' AND "lineorder"."lo_linenumber" >= 5 AND "supplier"."s_name" IN ('Supplier#000002666', 'Supplier#000002661', 'Supplier#000002659', 'Supplier#000002662', 'Supplier#000000001', 'Supplier#000002672', 'Supplier#000002665') AND "dim_date"."d_dayofweek" NOT LIKE '%Thursday%'